import parcelPluginHandlebars from '@inventory/parcel-plugin-handlebars'
import Layout from '../../layout/index.js'
import tmpl404 from './404.hbs'

export default class extends Layout {
  constructor(params) {
    super(params)
    this.setTitle('Ошибка 404')
    this.updateLayout('simple')
    this.subTitle = this.container.querySelector('.simple__page-content-item-subtitle')
    this.subTitle.innerText = '404'
    this.renderContent(content)
  }
  async getHtml() {
    const compiledFunction = Handlebars.compile(tmpl404)
    console.log(compiledFunction({arr: dialogs}))
    return compiledFunction({arr: dialogs})
}
}
